import React, { Components } from "react";


class SinglePizza extends Components() {

    constructor(props) {
        super(props);
        this.state = {
            items: [],
        };
    }
    componentDidMount() {
        axios
            .get("http://localhost:8000/api/pizza")
            // axios.get('https://yuitem-backend.herokuapp.com/api/item')
            .then((res) => {
                this.setState({ items: res.data });
            })
            .catch((error) => {
                console.log(error);
            });
    }

    render() {
        let pizzaList = this.state.items.map((item) => {
            return (
                <div className="container">
                    hey single pizza
                    {item.name}
                </div>
            );
        });
    }
}


export default SinglePizza;
